import React from 'react';
import nikklaus from './nikklaus.jpg'
const Posts = () => {
    return (
        <Grid container style={{marginTop:
        '20px'}}>     
    <Avatar src={nikklaus} style={{width:'60px',height:'60px',marginLeft:'20px'}}/>       
    <input style={{marginLeft:'20px',width:'300px', border:'red', borderRadius:'999px', Align:'center'}} type="text" placeholder="What's on your mind dawg?"/>


      </Grid>
     );
}
 
export default Posts;
